// ...
const app = express();

app.use(bodyParser.json());
app.use(cors());

app.post('/api/data', (req, res) => {
  const data = req.body;
  // Save the data to a database or a file
  res.status(201).json(data);
});

// ...
```

7. Start both the backend and frontend servers:

```
cd backend
node server.js

cd ../frontend
npm start
```

8. To build the React app for production, run:

```
npm run build
